    const handleClick = () => {
        setShowModal(false)
    }

    const handlesubmit=(e)=>
    {
        e.preventDefault()
    }
    const isSignUp= true
    return (

        <div className="auth-modal">
            <div className="close-icon" onClick={handleClick}>X</div>

            <h2>{isSignUp ? 'CREATE ACCOUNT' : 'LOG IN'}</h2>
            <p>By clicking Log In, youagree to our terms. Learn how we process your data in our Privacy Policy and cookie Policy</p>

            <form onSubmit={handlesubmit}>
                <input
                    type="email"
                    id="email"
                    name="email"
                    placeholder="email"
                    required={true}
                    onChange={(e)=> setE}
                />
            </form>
            AuthModal
        </div>
    )
}
export default AuthModal
